tables.table_schema:
CREATE TABLE delivery_routes (
    route_id INT PRIMARY KEY,
    start_location TEXT,
    end_location TEXT,
    distance_km FLOAT
);

CREATE TABLE delivery_orders (
    order_id INT PRIMARY KEY,
    route_id INT,
    delivery_date DATE,
    delivery_time TIME
);

CREATE TABLE route_performance (
    route_id INT,
    delivery_date DATE,
    on_time BOOLEAN,
    delay_minutes INT
);

CREATE TABLE delivery_agents (
    agent_id INT PRIMARY KEY,
    agent_name TEXT,
    phone_number TEXT
);
